import './Post.module.css'


let classes = {
    'postContainer': '',
    'avaPosts': 'MyPorts_myPosts__6Q9c6',
    'item': 'MyPorts_item__xLrxo'
}

export const Post = () => {

    return (
        <div className="postContainer">
            <img className={classes.avaPosts}
                 src={'https://st2.depositphotos.com/1009868/45177/i/450/depositphotos_451772690-stock-photo-tambov-russian-federation-january-2021.jpg'}
            />
           <span className={classes.item}>Post</span>
        </div>
    )
}
